import React from 'react';
import '../styles/NewsButtons.css';  // Importing a stylesheet

const NewsButtons = () => {
    return (
        <div className="buttons-container">
            <button className="news-button" onClick={() => console.log('Politics clicked')}>Politics</button>
            <button className="news-button" onClick={() => console.log('Sports clicked')}>Sports</button>
            <button className="news-button" onClick={() => console.log('Technology clicked')}>Technology</button>
            <button className="news-button" onClick={() => console.log('Entertainment clicked')}>Entertainment</button>
        </div>
    );
};

export default NewsButtons;
